package com.ls.vo;

public class Location {
	double x, y;

	public Location() {
		// TODO Auto-generated constructor stub
	}

	public double getX() {
		return x;
	}

	public void setX(double x) {
		this.x = x;
	}

	public double getY() {
		return y;
	}

	public void setY(double y) {
		this.y = y;
	}

	public Location(double x, double y) {
		super();
		this.x = x;
		this.y = y;
	}

}
